            [App_StyleKit.red_15 setFill];
            [field_border_backgound2Path fill];
            [App_StyleKit.error_Border setStroke];
            field_border_backgound2Path.lineWidth = 2;
            [field_border_backgound2Path stroke];
        }
    }
