+ (void)drawNotification_badgeWithNotifications: (CGFloat)notifications
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();


    //// Variable Declarations
    BOOL isNotifications_checked = notifications != 0 && notifications > 0;
    NSString* notification_string = [NSString stringWithFormat: @"%ld", (NSInteger)round(notifications)];
    BOOL expand_notification_double_digit = notifications > 9 && notifications < 100;
    BOOL expand_notification_tripple_digit = notifications > 99 && notifications < 1000;
    BOOL expand_notification_quadrouple_digit = notifications > 999;

    if (isNotifications_checked)
    {
        //// notification
        {
            //// single_digit_notification Drawing
            UIBezierPath* single_digit_notificationPath = [UIBezierPath bezierPathWithRoundedRect: CGRectMake(2.12, 2.12, 35, 35) cornerRadius: 14];
            [App_StyleKit.seequFoam setFill];
            [single_digit_notificationPath fill];
            [UIColor.whiteColor setStroke];
            single_digit_notificationPath.lineWidth = 2;
            [single_digit_notificationPath stroke];


            //// single_digit_notification 2 Drawing
            UIBezierPath* single_digit_notification2Path = [UIBezierPath bezierPathWithRoundedRect: CGRectMake(6, 5.88, 27.06, 27.06) cornerRadius: 13.53];
            [App_StyleKit.seequFoam setFill];
            [single_digit_notification2Path fill];
            [UIColor.whiteColor setStroke];
            single_digit_notification2Path.lineWidth = 2;
            [single_digit_notification2Path stroke];


            if (expand_notification_double_digit)
            {
                //// double_digit_notification Drawing
                UIBezierPath* double_digit_notificationPath = [UIBezierPath bezierPathWithRoundedRect: CGRectMake(2.25, 2, 48.01, 35) cornerRadius: 17.5];
                [App_StyleKit.seequFoam setFill];
                [double_digit_notificationPath fill];
                [UIColor.whiteColor setStroke];
                double_digit_notificationPath.lineWidth = 2;
                [double_digit_notificationPath stroke];


                //// double_digit_notification 2 Drawing
                UIBezierPath* double_digit_notification2Path = [UIBezierPath bezierPathWithRoundedRect: CGRectMake(6.88, 6.25, 38.5, 26) cornerRadius: 13];
                [App_StyleKit.seequFoam setFill];
                [double_digit_notification2Path fill];
                [UIColor.whiteColor setStroke];
                double_digit_notification2Path.lineWidth = 2;
                [double_digit_notification2Path stroke];
            }


            if (expand_notification_tripple_digit)
            {
                //// tripple_digit_notification Drawing
                UIBezierPath* tripple_digit_notificationPath = [UIBezierPath bezierPathWithRoundedRect: CGRectMake(3.38, 2.25, 56.26, 35) cornerRadius: 17.5];
                [App_StyleKit.seequFoam setFill];
                [tripple_digit_notificationPath fill];
                [UIColor.whiteColor setStroke];
                tripple_digit_notificationPath.lineWidth = 2;
                [tripple_digit_notificationPath stroke];


                //// tripple_digit_notification 2 Drawing
                UIBezierPath* tripple_digit_notification2Path = [UIBezierPath bezierPathWithRoundedRect: CGRectMake(8.62, 6.87, 45.62, 25.37) cornerRadius: 12.69];
                [App_StyleKit.seequFoam setFill];
                [tripple_digit_notification2Path fill];
                [UIColor.whiteColor setStroke];
                tripple_digit_notification2Path.lineWidth = 2;
                [tripple_digit_notification2Path stroke];
            }


            if (expand_notification_quadrouple_digit)
            {
                //// quadrouple_digit_notification Drawing
                UIBezierPath* quadrouple_digit_notificationPath = [UIBezierPath bezierPathWithRoundedRect: CGRectMake(1.25, 2.25, 71.38, 35) cornerRadius: 17.5];
                [App_StyleKit.seequFoam setFill];
                [quadrouple_digit_notificationPath fill];
                [UIColor.whiteColor setStroke];
                quadrouple_digit_notificationPath.lineWidth = 2;
                [quadrouple_digit_notificationPath stroke];


                //// quadrouple_digit_notification 2 Drawing
                UIBezierPath* quadrouple_digit_notification2Path = [UIBezierPath bezierPathWithRoundedRect: CGRectMake(6.75, 7.12, 60.25, 25.25) cornerRadius: 12.63];
                [App_StyleKit.seequFoam setFill];
                [quadrouple_digit_notification2Path fill];
                [UIColor.whiteColor setStroke];
                quadrouple_digit_notification2Path.lineWidth = 2;
                [quadrouple_digit_notification2Path stroke];
            }


            //// Text Drawing
            CGRect textRect = CGRectMake(13.88, 9.88, 47.76, 20.5);
            NSMutableParagraphStyle* textStyle = NSMutableParagraphStyle.defaultParagraphStyle.mutableCopy;
            textStyle.alignment = NSTextAlignmentLeft;

            NSDictionary* textFontAttributes = @{NSFontAttributeName: [UIFont fontWithName: @"HelveticaNeue-Bold" size: 21], NSForegroundColorAttributeName: UIColor.whiteColor, NSParagraphStyleAttributeName: textStyle};

            CGFloat textTextHeight = [notification_string boundingRectWithSize: CGSizeMake(textRect.size.width, INFINITY)  options: NSStringDrawingUsesLineFragmentOrigin attributes: textFontAttributes context: nil].size.height;
            CGContextSaveGState(context);
            CGContextClipToRect(context, textRect);
            [notification_string drawInRect: CGRectMake(CGRectGetMinX(textRect), CGRectGetMinY(textRect) + (CGRectGetHeight(textRect) - textTextHeight) / 2, CGRectGetWidth(textRect), textTextHeight) withAttributes: textFontAttributes];
            CGContextRestoreGState(context);
        }
    }
