+ (void)drawConatct_row_phoneWithFrame2: (CGRect)frame2 frame3: (CGRect)frame3 firstName: (NSString*)firstName lastName: (NSString*)lastName title: (NSString*)title company: (NSString*)company
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();


    //// Variable Declarations
    NSString* contactName = [[firstName stringByAppendingString: @" "] stringByAppendingString: lastName];
    NSString* titleCompany = [[title stringByAppendingString: @"  "] stringByAppendingString: company];

    //// Symbol Drawing
    CGRect symbolRect = CGRectMake(CGRectGetMinX(frame2) + 15, CGRectGetMinY(frame2) + 10, 64, 64);
    CGContextSaveGState(context);
    UIRectClip(symbolRect);
    CGContextTranslateCTM(context, symbolRect.origin.x, symbolRect.origin.y);

    [App_StyleKit drawContact_profile_photo_placeholder];
    CGContextRestoreGState(context);


    //// Symbol 2 Drawing
    CGRect symbol2Rect = CGRectMake(CGRectGetMinX(frame2) + 7, CGRectGetMinY(frame2) + 2, 80, 80);
    CGContextSaveGState(context);
    UIRectClip(symbol2Rect);
    CGContextTranslateCTM(context, symbol2Rect.origin.x, symbol2Rect.origin.y);

    [App_StyleKit drawContact_status_ringWithAway: NO];
    CGContextRestoreGState(context);


    //// Text 2 Drawing
    CGRect text2Rect = CGRectMake(CGRectGetMinX(frame3) + 3.5, CGRectGetMinY(frame3) + 5, 246, 18);
    NSMutableParagraphStyle* text2Style = NSMutableParagraphStyle.defaultParagraphStyle.mutableCopy;
    text2Style.alignment = NSTextAlignmentLeft;

    NSDictionary* text2FontAttributes = @{NSFontAttributeName: [UIFont fontWithName: @"HelveticaNeue-Light" size: 20], NSForegroundColorAttributeName: App_StyleKit.seequFoam, NSParagraphStyleAttributeName: text2Style};

    CGFloat text2TextHeight = [contactName boundingRectWithSize: CGSizeMake(text2Rect.size.width, INFINITY)  options: NSStringDrawingUsesLineFragmentOrigin attributes: text2FontAttributes context: nil].size.height;
    CGContextSaveGState(context);
    CGContextClipToRect(context, text2Rect);
    [contactName drawInRect: CGRectMake(CGRectGetMinX(text2Rect), CGRectGetMinY(text2Rect) + (CGRectGetHeight(text2Rect) - text2TextHeight) / 2, CGRectGetWidth(text2Rect), text2TextHeight) withAttributes: text2FontAttributes];
    CGContextRestoreGState(context);


    //// Text 3 Drawing
    CGRect text3Rect = CGRectMake(CGRectGetMinX(frame3) + 4, CGRectGetMinY(frame3) + 31, 246, 18);
    NSMutableParagraphStyle* text3Style = NSMutableParagraphStyle.defaultParagraphStyle.mutableCopy;
    text3Style.alignment = NSTextAlignmentLeft;

    NSDictionary* text3FontAttributes = @{NSFontAttributeName: [UIFont fontWithName: @"HelveticaNeue-Light" size: 15], NSForegroundColorAttributeName: App_StyleKit.black_50, NSParagraphStyleAttributeName: text3Style};

    CGFloat text3TextHeight = [titleCompany boundingRectWithSize: CGSizeMake(text3Rect.size.width, INFINITY)  options: NSStringDrawingUsesLineFragmentOrigin attributes: text3FontAttributes context: nil].size.height;
    CGContextSaveGState(context);
    CGContextClipToRect(context, text3Rect);
    [titleCompany drawInRect: CGRectMake(CGRectGetMinX(text3Rect), CGRectGetMinY(text3Rect) + (CGRectGetHeight(text3Rect) - text3TextHeight) / 2, CGRectGetWidth(text3Rect), text3TextHeight) withAttributes: text3FontAttributes];
    CGContextRestoreGState(context);


    //// Symbol 3 Drawing
    CGRect symbol3Rect = CGRectMake(392, 15, 64, 64);
    CGContextSaveGState(context);
    UIRectClip(symbol3Rect);
    CGContextTranslateCTM(context, symbol3Rect.origin.x, symbol3Rect.origin.y);

    [App_StyleKit drawContact_slide_arrow];
    CGContextRestoreGState(context);
}

