+ (void)drawContact_alpha_seperatorWithAlpha_string: (NSString*)alpha_string
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();

    //// Oval Drawing
    CGContextSaveGState(context);
    CGContextTranslateCTM(context, 105.33, 5);
    CGContextScaleCTM(context, 2, 2);

    UIBezierPath* ovalPath = [UIBezierPath bezierPathWithOvalInRect: CGRectMake(0, 0, 20, 20)];
    [App_StyleKit.seequFoam setStroke];
    ovalPath.lineWidth = 1;
    [ovalPath stroke];

    CGContextRestoreGState(context);


    //// Bezier Drawing
    CGContextSaveGState(context);
    CGContextTranslateCTM(context, 9.83, 24.83);
    CGContextScaleCTM(context, 2, 2);

    UIBezierPath* bezierPath = UIBezierPath.bezierPath;
    [bezierPath moveToPoint: CGPointMake(0, 0)];
    [bezierPath addLineToPoint: CGPointMake(40, 0)];
    [App_StyleKit.seequFoam setStroke];
    bezierPath.lineWidth = 1;
    [bezierPath stroke];

    CGContextRestoreGState(context);


    //// Text Drawing
    CGContextSaveGState(context);
    CGContextTranslateCTM(context, 105.17, 7.5);
    CGContextScaleCTM(context, 2, 2);

    CGRect textRect = CGRectMake(0, 0, 20.33, 17.5);
    NSMutableParagraphStyle* textStyle = NSMutableParagraphStyle.defaultParagraphStyle.mutableCopy;
    textStyle.alignment = NSTextAlignmentCenter;

    NSDictionary* textFontAttributes = @{NSFontAttributeName: [UIFont fontWithName: @"HelveticaNeue-Light" size: UIFont.labelFontSize], NSForegroundColorAttributeName: App_StyleKit.seequFoam, NSParagraphStyleAttributeName: textStyle};

    CGFloat textTextHeight = [alpha_string boundingRectWithSize: CGSizeMake(textRect.size.width, INFINITY)  options: NSStringDrawingUsesLineFragmentOrigin attributes: textFontAttributes context: nil].size.height;
    CGContextSaveGState(context);
    CGContextClipToRect(context, textRect);
    [alpha_string drawInRect: CGRectMake(CGRectGetMinX(textRect), CGRectGetMinY(textRect) + CGRectGetHeight(textRect) - textTextHeight, CGRectGetWidth(textRect), textTextHeight) withAttributes: textFontAttributes];
    CGContextRestoreGState(context);

    CGContextRestoreGState(context);


    //// Bezier 2 Drawing
    CGContextSaveGState(context);
    CGContextTranslateCTM(context, 161.83, 24.83);
    CGContextScaleCTM(context, 2, 2);

    UIBezierPath* bezier2Path = UIBezierPath.bezierPath;
    [bezier2Path moveToPoint: CGPointMake(0, 0)];
    [bezier2Path addLineToPoint: CGPointMake(40, 0)];
    [App_StyleKit.seequFoam setStroke];
    bezier2Path.lineWidth = 1;
    [bezier2Path stroke];

    CGContextRestoreGState(context);
}

